// import the api for testing
const api = require('./api');
// import request to hit the api end point
const request = require('supertest');
// import usermethods to wipe test data
import UserMethods from './middleware/userMethods'
//define port
const PORT = 9000;
let server: any;

describe('/auth route:', () => {
    beforeEach(() => {
        server = api.listen(PORT, () => {
            console.log(`He is beginning to believe. Port: ${PORT}`);
        })
    })
    afterEach((done: any) => {
        server.close(done);
    })

  // no cookies test for /auth
  test('no cookies return 401: isAuth: false', async() => {
    const response: any  = await request(api).get('/api/auth');
    expect(response.status).toEqual(401);
    expect(response.type).toEqual('application/json');
    expect(response.body).toEqual({isAuth: false})
  });
});

