describe('/registration route:', () => {

    beforeEach(() => {
        server = api.listen(PORT, () => {
            console.log(`He is beginning to believe. Port: ${PORT}`);
        })
    })
    afterEach((done: any) => {
        server.close(done);
    })

  // invalid /register attempt...duplicate email
  test('registering with an existing email address returns 401 Registration Failure', async() => {
    const register = {
      registerEmail: "meka1111@meka.com",
      confirmPassword: "jeeves2k18",
      firstName: "Joel",
      lastName: "Perkins",
      agreeTerms: true,
    };
    const response: any = await request(api).post('/api/register').send(register);
    expect(response.status).toEqual(401);
    expect(response.type).toEqual('text/html');
    expect(response.text).toEqual('REGISTRATION FAILURE');
  })

  // empty body register
  test('attempting to register with an empty body results in a failure', async() => {
    const register = {};
    const response: any = await request(api).post('/api/register').send(register);
    expect(response.status).toEqual(401);
    expect(response.type).toEqual('text/html');
    expect(response.text).toEqual('REGISTRATION FAILURE, EMPTY BODY');
  })

  // valid registration
  test('attempting to register with all info will reigster a user', async () => {
    const register: any = {
      "registerEmail": "joel@joel.com",
      "confirmPassword": "passw0rd",
      "firstName": "Joel",
      "lastName": "Perkins",
      "agreeTerms": false,
      "surveyComplete": false,
      "issuesComplete": false
    };
    const response: any = await request(api).post('/api/register').send(register);
    expect(response.status).toEqual(200);
    expect(response.type).toEqual('application/json');
    const userObject = await UserMethods.getId(register.registerEmail);
    const responseObject: any = {
        "userId": userObject.id,
        "surveyComplete": false,
        "issuesComplete": false,
        "firstName": "Joel",
        "lastName": "Perkins",
        "isAuth": true
    };
    expect(response.body).toEqual(responseObject);
    await UserMethods.deleteUser(register.registerEmail);
  })
});

